import React from 'react';
import DashboardGrid from './DashboardGrid';

const DashboardLayout = () => {
  return (
    <div className="dashboard-layout">
      <h1>Dashboard Layout</h1>
      <DashboardGrid />
    </div>
  );
};

export default DashboardLayout;
